        Update Password
      </h1>
      <form onSubmit={han}>
        <Field component={renderFeild} label="Enter old password" />
        <Field component={renderFeild} label="Enter new password" />
        <Field component={renderFeild} label="Repeat  new password" />
        <button className="bg-red-800 rounded-lg text-white py-2 px-8 mt-4 hover:bg-red-500" onSubmit="submit">
          Update Password
        </button>
      </form>
    </div>
  );
};

const validate = ({ oldPassword, newPassword, repeatPassword }) => {
  const error = {};

  if (!oldPassword) {
    error.oldPassword = "old password feild cannot be is empty";
  }

  if (!newPassword) {
    error.newPassword = "new password feild cannot be empty";
  }

  if (!repeatPassword) {
    error.repeatPassword = "repeat password feild cannot be empty";
  }

  return error;
};

export default reduxForm({
  form: "updatePassword",
  validate,
})(Settings);
